  true,\n\t\"url\": null,\n\t\"notes\": \"This submission contains an update to the
  previous Exploration Gap Assessment funded in 2012, which identify high potential
  hydrothermal areas where critical data are needed (gap analysis on exploration data).nnThe
  uploaded data are contained in two data files for each data category: A shape (SHP)
  file containing the grid, and a data file (CSV) containing the individual layers
  that intersected with the grid. This CSV can be joined with the map to retrieve
  a list of datasets that are available at any given site.  A grid of the contiguous
  U.S. was created with 88,000 10-km by 10-km grid cells, and each cell was populated
  with the status of data availability corresponding to five data types:nn1. well
  data n2. geologic mapsn3. fault mapsn4. geochemistry datan5. geophysical data\",\n\t\"license_title\":
